import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  AppBar,
  Button,
  Typography
  } from '@material-ui/core';

import ThreatMap from './ThreatMap';

function App(){
  return(
    <div>
      <AppBar color="primary">
        <Typography>Demo App</Typography>
      </AppBar>
      <BrowserRouter>
        <div>
          <Button color="primary" component={Link} to="/">
            Home
          </Button>
          <Button color="primary" component={Link} to="/network-threat-map">
            Network incidents near you
          </Button>
          <Switch>
            <Route path='/network-threat-map'>
              <ThreatMap />
            </Route>
          </Switch>
        </div>
      </BrowserRouter>
    </div>
  );
};

export default App;
